import logo from './cappslogo.jpg';
import './App.css';
import Form from'./Form.js';
import { Dropdown } from './Dropdown.js'
import { DropdownElement } from './DropdownElement.js'
import { GetLengths, GetDiameters, GetPitch, GetNutType } from './GetValues.js'


function App() {
  return (
    <div className="App" id="header">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Welcome to the CAPPS bolt configurator app!
        </p>
      </header>
      <div className="Configurator">
        <DropdownElement label="Length:   " array={Get}/>
        <DropdownElement label="Diameter:   " array={[15,32,40,55]}/>
        <DropdownElement label="Pitch:   " array={[5,10,15]} />
        <DropdownElement label="Nut Type:   " array={["Copper","Steel"]}/>
      </div>
    </div>
  );
}

export default App;
